window.bookSummaryJSON = "<p><b>He'll make me his at any cost....</b></p> <p>Lily</p> <p>Hot, surly, Fae vampire, Gabriel, kidnapped me to get the attention of the Fae Corps. He demands that I obey him. I am determined to resist him. He will not stop until he's tamed my spirit. I will not succumb to his charms. He has me captive, threatens to own me in every way possible... But I cannot, will not give in to him...I hope.</p> <p>Fast-paced dark Fae romance, starring a feisty woman and the Fae male strong enough to make her his!</p>"; 
